export const Paginado = ({
    dogsCardsPerPage,
    allDogs,
    paginado,
    paginadoPrev,
    paginadoNext,
    currentPage,
  }) => {
    const pageNumbers = [];
  
    for (let i = 1; i <= Math.ceil(allDogs / dogsCardsPerPage); i++) {
      pageNumbers.push(i);
    }
  
    return (
      <nav>
        <div>
          <div onClick={paginadoPrev}>
          </div>
          {pageNumbers.map((number) => (
            <div
              key={number}
              onClick={() => paginado(number)}
            >
              {number}
            </div>
          ))}
          <div onClick={paginadoNext}>
          </div>
        </div>
      </nav>
    );
  };
